import './App.css';

import Navbar from './components/Navbar.js';
import Hero from './components/Hero.js';
import Features from './components/Features.js';
import Content from './components/Content.js';



function App() {
  return (
    <div class="container">
      <Navbar />
      <Hero />
      <Features />
      <Content />


    </div>
  );
}

export default App;
